INSERT INTO "public"."checklist_steps" ("id", "label", "description", "updated_at") VALUES
	('c79efe17-49fe-43ed-9b7a-98e3378067f0', 'Assemble an Emergency Kit', 'Collect essential supplies like food, water, medications, flashlights, and a first aid kit. Aim for a 72-hour supply to sustain you during the initial phase of an emergency.', '2025-10-20 22:02:39.937733'),
	('9ebe7523-ecd7-4800-ad39-b75f27b392c4', 'Create a Family Communication Plan', 'Establish a way to communicate with family members during an emergency, including identifying a central contact person outside the area for everyone to check in with.', '2025-10-20 22:02:39.941805'),
	('00223326-8dab-4e3f-8e32-c1cb50b87ef4', 'Know Your Local Risks', 'Identify specific risks in your area, such as hurricanes, earthquakes, or flooding, to better tailor your emergency preparations.', '2025-10-20 22:02:39.944228'),
	('3b939572-9197-4a57-82a2-dafb37b13fb9', 'Learn Basic First Aid and CPR', 'Familiarize yourself with first aid and CPR techniques, which can be crucial during emergencies if immediate medical help isn’t available.', '2025-10-20 22:02:39.94662'),
	('c56e7abc-8d27-4c72-8609-7df09fa359a4', 'Secure Important Documents', 'Gather and protect important documents, like identification, insurance policies, and medical records, storing them in a waterproof, fireproof container.', '2025-10-20 22:02:39.949014'),
	('24ee1ef0-330a-4c13-836d-71f950ac1348', 'Develop an Emergency Response Plan', 'Create a comprehensive response plan detailing evacuation routes, shelter-in-place procedures, and communication protocols.', '2025-10-20 22:02:39.953604'),
	('25f18cf5-ec5e-4606-ada6-ca13e5cf6d56', 'Conduct Regular Drills', 'Schedule drills for various scenarios like fire, earthquake, or active shooter situations to ensure employees know what to do in an emergency.', '2025-10-20 22:02:39.955859'),
	('0569c4f9-0146-4e12-af22-b4fbe9b55808', 'Establish a Communication Chain', 'Identify key personnel responsible for communicating updates during an emergency and establish clear methods for reaching all employees.', '2025-10-20 22:02:39.958138'),
	('e2c2fc8d-ed81-422a-ad1e-0c0192b3c518', 'Stock Workplace Emergency Supplies', 'Ensure the workplace has accessible emergency supplies, including first aid kits, fire extinguishers, and personal protective equipment.', '2025-10-20 22:02:39.960378'),
	('e96c432c-3bb1-4bae-9ffb-cf95a3a963b8', 'Train Employees on Emergency Procedures', 'Provide regular training on the emergency response plan, including how to safely evacuate, assist colleagues, and locate emergency supplies.', '2025-10-20 22:02:39.96264'),
